import React from 'react';

const WeatherWidget = () => {
  return (
    <div>
      <h1>Weather Forecast</h1>
      
      {/* Replace this iframe code with the actual embed code provided by Weather.com or your preferred weather service */}
      <iframe
        src="https://www.weather.com/widgets/iframe/local.html"
        width="500"
        height="300"
        title="Weather Widget"
      ></iframe>
      
      <p>Other content here.</p>
    </div>
  );
};

export default WeatherWidget;
